import React from 'react'

function TopsAnimes({topanime}) {
    return (
        <section>  
            <h3>top <span>10</span> animes</h3>
            <nav>
            {topanime.map(anime=>(
                <a href={anime.url} target="_blank" rel="noreferrer" key={anime.mal_id}>
                    {anime.title}
                </a>          
            ))}
            </nav>
        </section>
    )
}

export default TopsAnimes
